INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000001, "カリン", 3.414, 1, 190801, 1, "2025/01/31 12:00:00", 1, "2030/01/01 14:59:59", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 0.0, -416.5, 2, 62);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000002, "カリン", 3.099, 2, 190801, 1, "2025/01/31 12:00:00", 1, "2030/01/01 14:59:59", "ミッションをクリアして、\n報酬をゲットしましょう！", 0.0, -416.5, 2, 62);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000003, "カリン", 2.801, 3, 190801, 1, "2025/01/31 12:00:00", 1, "2030/01/01 14:59:59", "受け取ることができる\n報酬があるようです\n確認してみてください", 0.0, -416.5, 2, 63);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000004, "カリン", 0.0, 4, 190801, 1, "2025/01/31 12:00:00", 2, "2030/01/01 14:59:59", "報酬がもらえますよ！\nチェックしてみてください", 0.0, -416.5, 2, 63);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000005, "カリン", 2.12, 5, 190801, 1, "2025/01/31 12:00:00", 2, "2030/01/01 14:59:59", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 0.0, -363.0, 1, 64);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000006, "カリン", 1.68, 6, 190801, 1, "2025/01/31 12:00:00", 1, "2030/01/01 14:59:59", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 0.0, -363.0, 2, 64);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1000007, "カリン", 2.33, 7, 190801, 1, "2025/01/31 12:00:00", 2, "2030/01/01 14:59:59", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 0.0, -363.0, 1, 64);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020101, "ラビリスタ", 5.18, 101, 133701, 10201, "2025/01/31 12:00:00", 3, "2030/01/01 14:59:59", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", -6.0, -285.0, 7, 61);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020102, "クリスティーナ", 8.77, 201, 133901, 10201, "2025/01/31 12:00:00", 1, "2030/01/01 14:59:59", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", -2.0, -285.0, 2, 61);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020103, "ネネカ", 15.5, 301, 133801, 10201, "2025/01/31 12:00:00", 6, "2030/01/01 14:59:59", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 0.0, -285.0, 1, 61);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020201, "ランファ", 9.061, 101, 134301, 10202, "2025/02/28 12:00:00", 2, "2030/01/01 14:59:59", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 0.0, -285.0, 5, 61);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020202, "チカ", 7.699, 201, 134401, 10202, "2025/02/28 12:00:00", 1, "2030/01/01 14:59:59", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 0.0, -285.0, 2, 61);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020301, "アオイ", 8.595, 101, 134601, 10203, "2025/03/31 12:00:00", 1, "2030/01/01 14:59:59", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 0.0, -285.0, 2, 61);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020302, "クローチェ", 7.758, 201, 134501, 10203, "2025/03/31 12:00:00", 1, "2030/01/01 14:59:59", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 0.0, -285.0, 2, 61);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020401, "ルイズマリー", 7.0, 101, 132302, 10204, "2025/04/30 12:00:00", 2, "2030/01/01 14:59:59", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 0.0, -285.0, 6, 61);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020402, "イロハ", 7.904, 201, 132402, 10204, "2025/04/30 12:00:00", 1, "2030/01/01 14:59:59", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 0.0, -285.0, 2, 61);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1020403, "ソノ", 8.487, 301, 132502, 10204, "2025/04/30 12:00:00", 4, "2030/01/01 14:59:59", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 0.0, -285.0, 2, 61);
